const getAllBoxes = async (req, res) => {
  const { boxId, ProductId, nameProduct, userId, userName, storeId } = req.body;

  const whereProduct = {};
  const whereUser = {};
  const whereBox = {};
  const whereStore = {};

  if (boxId) whereBox.id = boxId;
  if (ProductId) whereProduct.id = ProductId;
  if (nameProduct) whereProduct.name = nameProduct;
  if (userId) whereUser.id = userId;
  if (userName) whereUser.userName = userName;
  if (storeId) whereStore.id = storeId;

  console.log(storeId);

  try {
    const boxes = await Box.findAll({
      where: whereBox,
      include: [
        {
          model: User,
          where: whereUser,
        },
        {
          model: Boxammount,
          attributes: ["ammount"],
          include: [
            {
              model: Product,
              attributes: ["name"],
              where: whereProduct,
            },
          ],
        },
        {
          model: Substore,
          include: [
            {
              model: Store,
              where: whereStore,
            },
          ],
        },
      ],
      order: [["id", "DESC"]],
    });

    // if (storeId) {
    //   filteredBoxes = boxes.filter(box => box.Substore !== null);
    // }

    filteredBoxes = boxes.filter((box) => box.Boxammounts.length > 0);
    res.status(200).json(filteredBoxes);
  } catch (error) {
    console.log(error.message);
    res
      .status(404)
      .json({ message: "error al obtener las cajas", detail: error.message });
  }
};

const getBoxById = async (req, res) => {
  const { id } = req.params;
  try {
    const box = await Box.findByPk(id, {
      include: [
        {
          model: User,
          attributes: ["firstName", "userName", "id"],
        },
        {
          model: Boxammount,
          attributes: ["ammount"],
          include: [
            {
              model: Product,
              attributes: ["name"],
            },
          ],
        },
      ],
    });
    if (!box) {
      return res.status(404).json({ message: "Caja no encontrada" });
    }
    res.status(200).json(box);
  } catch (error) {
    console.log(error.message);
    res
      .status(500)
      .json({ message: "Error al obtener la caja", error: error.message });
  }
};

const csvBoxes = async (req, res) => {
  const { dateStart, dateEnd } = req.body;

  const where = {};

  if (dateStart && dateEnd) {
    const startDate = new Date(dateStart);
    const endDate = new Date(dateEnd);

    where.type = "empaque";

    where.date = {
      [Op.between]: [startDate, endDate],
    };
  }

  try {
    const boxes = await Box.findAll({
      where,
      include: [
        {
          model: User,
          attributes: ["firstName", "userName", "id"],
        },
        {
          model: Boxammount,
          attributes: ["ammount"],
          include: [
            {
              model: Product,
              attributes: ["name"],
            },
          ],
        },
        {
          model: Substore,
          include: [
            {
              model: Store,
            },
          ],
        },
      ],
      order: [["id", "DESC"]],
      raw: true,
    });

    const csvWriter = createCsvWriter({
      path: "boxes.csv",
      header: [
        { id: "id", title: "ID" },
        { id: "high", title: "High" },
        { id: "wide", title: "Wide" },
        { id: "large", title: "Large" },
        { id: "type", title: "Type" },
        { id: "height", title: "Height" },
        { id: "date", title: "Date" },
        { id: "reimpressionAmmount", title: "Reimpress amount" },
        { id: "itsSell", title: "Is Sell" },
        { id: "cost", title: "Cost" },
        { id: "dollarCost", title: "Dollar Cost" },
        { id: "detailOrder", title: "Detail Order" },
        { id: "SubstoreId", title: "Substore ID" },
        { id: "UserId", title: "User ID" },
        { id: "User.firstName", title: "First Name" },
        { id: "User.userName", title: "User Name" },
        { id: "Boxammounts.ammount", title: "Box Amount" },
        { id: "Boxammounts.Product.id", title: "Product ID" },
        { id: "Boxammounts.Product.name", title: "Product Name" },
        { id: "Substore.id", title: "Substore ID" },
        { id: "Substore.name", title: "Substore Name" },
        { id: "Substore.StoreId", title: "Store ID" },
        { id: "Substore.UserId", title: "User ID" },
        { id: "Substore.Store.id", title: "Store ID" },
        { id: "Substore.Store.name", title: "Store Name" },
        { id: "Substore.Store.country", title: "Store Country" },
        { id: "Substore.Store.state", title: "Store State" },
        { id: "Substore.Store.city", title: "Store City" },
        { id: "Substore.Store.address", title: "Store Address" },
        { id: "Substore.Store.UserId", title: "Store User ID" },
      ],
    });

    await csvWriter.writeRecords(boxes);

    res.download("boxes.csv");
  } catch (error) {
    res.status(400).json(error.message);
  }
};

